    render() {
        return ( <
            MyContext.Provider >
            <
            div className = "container-fluid app__containter" >
            <
            header className = "app__container-header" > { this.props.children[0] } <
            /header> <
            main className = "app__container-results" > { this.props.children[1] } <
            /main> <
            /div> <
            /MyContext.Provider>
        );
    }
}

export default AppContainer;
